var setContracts = function() {
    if (platformClientAddress == "") {
        platformClientAddress = platformClientAddressDefault;
    }
    if (platformManagerAddress == "") {
        platformManagerAddress = platformManagerAddressDefault;
    }

    platformClient = eth.contract(PlatformClientCompiled.abi).at(platformClientAddress);
    platformManager = eth.contract(PlatformManagerCompiled.abi).at(platformManagerAddress);
    
};

var setAddrs = function(data) {
    platformClientAddress = data.platformClientAddress;
    platformManagerAddress = data.platformManagerAddress;
    
    platformClient = eth.contract(PlatformClientCompiled.abi).at(platformClientAddress);
    platformManager = eth.contract(PlatformManagerCompiled.abi).at(platformManagerAddress);
    
};

