var assert = function(value, desc) {
    var msg = value ? ' -> PASS' : ' -> *** FAIL ***';
    if (typeof desc !== 'undefined' && !value) { msg = msg + ' - ' + desc; }
    return msg;
}

var str2DoubleB32 = function(input) {
    var account = web3.fromAscii(input);
    var str = account.substring(2);  // remove 0x;
    var b1 = '0x' + str.substring(0, 64);
    b1 = (b1 === '0x'? '0x0' : b1);
    var b2 = '0x' + str.substring(64, 128);
    b2 = (b2 === '0x'? '0x0' : b2);
    var doubleB32 = [b1,b2];
    return doubleB32;
}

